import React from "react";

function About() {
    return (
        <main>
            <section className="hero">
                <div className="hero-content">
                    <p>
                        Providing humble service with proud <span className="emphasis">15+</span> years of experience, from the early days of Law school to today's old age endeavors. Find out more by clicking on the button!
                    </p>
                    <button className="CV">Download CV here</button>
                </div>
                <div className="hero-image">
                    <img src="/Fekadu.jpg" alt="Fekadu Hailemariam" />
                </div>
            </section>
        </main>
    );
}

export default About;
